import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
      <div>
        <div><Menu /></div>
        <div><HeaderOne /></div>
        <div><Header /></div>
      </div>
    );
}

const HeaderOne = () => {
  return (
    <div>
  <ul>FrontEndDev:
   <li>CSS</li>
   <li>HTML</li>
   <li>JavaScript</li>
   <li>React</li>
  </ul>
    </div>
  )
}



const Header = () => {
    return (
      <div>
    <ul>BackEndDev:
     <li>Node</li>
     <li>PHP</li>
     <li>MySQl</li>
    </ul>
      </div>
    );
}

const Menu = () => {
  return (
    <div class="menu">
      <a href="#">Home </a>
      <a href="http://Yandex.ru">Yandex </a>
      <a href="http://Google.com">Google</a>
    </div>
  )
}



export default App;
